class File:
    def __init__(self, path):
        self.path = path

    def write(self, text):
        with open(self.path, 'w') as f:
            f.write(text)

    def read(self):
        with open(self.path, 'r') as f:
            return f.read()

    def __add__(self, other):
        return File(self.path + other.path)

    def __iter__(self):
        return self

    def __next__(self):
        with open(self.path, 'r') as f:
            return f.readline()

    def __str__(self):
        return self.path


